class Stock:
    def __init__(self, stock_name: str, silent: bool = False):
        """
        Open, High, Low, Close, Volume, Hour, DayofYear, Days2Next -> High, Low, Chance | Next 5 days
        Open, High, Low, Close, Volume, Hour, DayofYear, Days2Next -> Tomorrow, Chance
        
        Inputs available through .stock:
        Open, High, Low, Close, Volume, Hour, DayofYear, Days2Next
        Outputs available through .stock:
        NextClose, NextOpen, NextHigh, NextLow, NextVolume, WeeklyHigh, WeeklyLow | Weekly = next 5 working days
        
        In-completeness: last 10 days -> Avoid in training
        """
        try:
            self.silent = silent
            self.print = print if not self.silent else self.dummy_print
            self.repair = False
            self.stock_name = stock_name.upper()
            self.print(f"Retrieving stock data for {self.stock_name} ", end="", flush=True)
            print("1/6", end=" ", flush=True)
            self.stock = yf.Ticker(self.stock_name)
            print("2/6", end=" ", flush=True)
            self.long_term_data = self.stock.history(period="max", interval="1d", timeout = 10, repair = self.repair)
            print("3/6", end=" ", flush=True)
            self.long_term_trends = {}
            self.stock = self.stock.history(period="1y", interval="1h", timeout = 10, repair = self.repair)
            print("4/6", end=" ", flush=True)
            self.working = True
            if self.stock.empty:
                self.stock = yf.Ticker(self.stock_name)
                print("5/6", end=" ", flush=True)
                self.stock = self.stock.history(period="max", interval="1h", timeout = 10, repair = self.repair)
            if self.stock.empty:
                self.print(f"Failed to retrieve stock data for {self.stock_name}")
                self.working = False
                return
            self.prepare_data()
            
            self.print("6/6 Done!", flush=True)
            self.print("Formatting stock data: ", end="")
            self.fix_volume() #First hour of the day has 0 volume
            self.highs_cache = {}
            self.lows_cache = {}
            self.stock["NextClose"] = self.stock["Close"].shift(-1)
            self.stock["NextOpen"] = self.stock["Open"].shift(-1)
            self.stock["NextHigh"] = self.stock["High"].shift(-1)
            self.stock["NextLow"] = self.stock["Low"].shift(-1)
            self.stock["NextVolume"] = self.stock["Volume"].shift(-1)
            self.stock["Hour"] = self.stock.index.hour
            self.stock["DayofYear"] = self.stock.index.dayofyear
            self.print("1/6", end=" ", flush=True)
            self.stock["Days2Next"] = self.stock.index.map(self.next_day)
            self.print("2/6", end=" ", flush=True)
            self.stock["WeeklyHigh"] = self.stock.index.map(self.weekly_high) #After 5 day, next 5 days
            self.print("3/6", end=" ", flush=True)
            self.stock["WeeklyLow"] = self.stock.index.map(self.weekly_low) #Next 5 days
            self.print("4/6", end=" ", flush=True)

            self.stock["2yTrendM"] = self.stock.index.map(lambda x: self.trend(x, days=730, slope=True))
            self.stock["1yTrendM"] = self.stock.index.map(lambda x: self.trend(x, days=365, slope=True))
            self.stock["3mTrendM"] = self.stock.index.map(lambda x: self.trend(x, days=90, slope=True))
            self.stock["2yTrendC"] = self.stock.index.map(lambda x: self.trend(x, days=730, slope=False))
            self.stock["1yTrendC"] = self.stock.index.map(lambda x: self.trend(x, days=365, slope=False))
            self.stock["3mTrendC"] = self.stock.index.map(lambda x: self.trend(x, days=90, slope=False))
            self.print("5/6", end=" ", flush=True)

            self.stock_freq_map = self.create_freq_map() #H-L Mean map on stripped frequency        
            self.clean_up() #Remove rows/columns with incomplete data        
            self.print("6/6 Done!", flush=True)
        except Exception as e:
            print(f"Failed to retrieve stock data for {self.stock_name}", flush=True)
            print(e)
            self.working = False

