#optimized + clipped
def cost_function_batch_ln(ideal_input, current_input):
    return tf.add(tf.reduce_mean(tf.add(tf.divide(tf.square(tf.subtract(tf.clip_by_value(tf.abs(ideal_input[:,0]),10e-8, 10e+8),tf.clip_by_value(tf.abs(current_input[:,0]),10e-8, 10e+8))),tf.multiply(2.0,tf.square(tf.clip_by_value(tf.abs(current_input[:,1]), 10e-8,10e+8)))),tf.add(200.0,tf.math.log(tf.multiply(tf.clip_by_value(tf.abs(current_input[:,1]), 10e-8, 10e+8),tf.sqrt(2.0*np.pi)))))), tf.reduce_mean(tf.add(tf.divide(tf.square(tf.subtract(tf.clip_by_value(tf.abs(ideal_input[:,1]),10e-8, 10e+8),tf.clip_by_value(tf.abs(current_input[:,2]),10e-8, 10e+8))),tf.multiply(2.0,tf.square(tf.clip_by_value(tf.abs(current_input[:,3]), 10e-8,10e+8)))),tf.add(200.0,tf.math.log(tf.multiply(tf.clip_by_value(tf.abs(current_input[:,3]), 10e-8, 10e+8),tf.sqrt(2.0*np.pi)))))))

def cost_function_batch(ideal_input, current_input):
    return tf.reduce_mean(tf.pow(tf.subtract(ideal_input, current_input), 2))

